import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div style={{textAlign: 'center', padding: '50px'}}>
      <h1>Bem-vindo ao Sistema de Card√°pio</h1>
      <p>Gerencie seus pratos de forma simples e eficiente.</p>
      <div style={{marginTop: '30px'}}>
        <Link to="/listar" style={btnStyle}>Ver Pratos</Link>
        <Link to="/cadastro" style={{...btnStyle, marginLeft: '15px'}}>Cadastrar Novo Prato</Link>
      </div>
    </div>
  );
};

const btnStyle = {
  backgroundColor: '#0d6efd',
  color: 'white',
  padding: '12px 25px',
  borderRadius: '6px',
  textDecoration: 'none',
  fontWeight: '600',
  boxShadow: '0 2px 8px rgba(13,110,253,0.4)',
  transition: 'background-color 0.3s',
};

export default Home;
